X-Men XXX: An Axel Braun Parody (NEW 2014 Vivid Comix) (Split Scenes)

Allie Haze, Andy San Dimas, Chanel Preston, Jeanie Marie, Katie St. Ives, Skin Diamond, Alec Knight, Billy Glide, J. Jay, Mike Moz, Tom Byron, Tommy Gunn, AJ Stoan, Peter O'Tool

It was just a matter of time until mutants got the porn parody treatment, courtesy of Axel Braun and Vivid Entertainment...and it was worth the wait! Wolverine, Rogue, Cyclops, Jean Grey, Storm, Colossus, Kitty Pryde and Polaris join forces with Professor X to defeat the villans led by Magneto, in yet another parody masterpiece bound to become an instant classic.

